import IMAGES from "../images/index"

class Project {
    constructor(image, link, title, language, date) {
        this.image = image;
        this.link = link;
        this.title = title;
        this.language = language;
        this.date = date;
    }
}

const thisProject = new Project(
    IMAGES.pic1,
    "www.google.com",
    "This project",
    "JavaScript: React",
    "Today"
);

const resume = new Project(
    IMAGES.pic2,
    "www.bing.com",
    "Resume",
    "Python: Django",
    "Tomorrow"
);

let projects = [thisProject, resume];

export default projects;
